style.css:
@-moz-document domain("google.com") {
/* Cambia el color de fondo de la página */
  body {
    background-color: #040f25 !important;
  }

  /* Cambia el color de las letras de Google en la página de inicio */
  #hplogo > a > img {
    filter: brightness(0) invert(1);
  }

  /* Cambia el color de fondo del header */
  header, .gb_8d, .gb_Wd {
    background-color: #040f25 !important;
  }

  /* Cambia el color de fondo del footer */
  footer, .fbar {
    background-color: #040f25 !important;
  }

  /* Cambia el color de fondo de los contenedores */
  .gb_jf, .gb_Od {
    background-color: #040f25 !important;
  }

  /* Cambia el color de las letras del texto de búsqueda */
  .gLFyf, .gLFyf::placeholder {
    color: #DBF227 !important;
  }

  /* Cambia el color de las letras del menú superior */
  .gb_0c, .gb_1c, .gb_3c, .gb_4c, .gb_5c, .gb_6c, .gb_7c {
    color: #DBF227 !important;
  }

  /* Cambia el color de las letras en el footer */
  .fbar a, .fbar span {
    color: #DBF227 !important;
  }
}

